import food from "../csv2jsondata"

function Calcalorie(){
    const [searchInput,setSearch]=useState("changing...")
    function search(event){
        const searchInput=event.target.value
        // setSearch(food.filter(food))
        setSearch(searchInput)
        if (searchInput.length > 0){
               const fooddata=(food.filter((foods)=>{
                return foods.Food.toLowerCase().match(searchInput).forEach((data)=> {return setSearch(data)})}))
                    console.log(fooddata);
        }
        
    }
    return(
            <div>
                <form>
                Food:<input type="search" onChange={search} name="food" placeholder="search..." />
                <input defaultValue={searchInput} />
                <input type="submit" />

                </form>

            </div>


    )    



}

export default Calcalorie;
